import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import * as React from 'react';

import FormInputs from './component/FormInputs';
import {

  Button,
  TextField,
 FormControl,
  Typography,
  InputLabel,

} from "@mui/material";
import { textAlign } from '@mui/system';

function App() {
  return (<>
<React.Fragment>
      <CssBaseline />
      <FormControl>
      <Container maxWidth="sm">
        <Box sx={{ bgcolor: '#fff', height: '135px'  }}>

      <TextField id="outlined-basic" label="Bank Name" variant="outlined" />
      <TextField type="number" id="outlined-basic" label="Outstanding Amount" variant="outlined" />
      <TextField type="number" id="outlined-basic" label="Interest Rate " variant="outlined" />
      <TextField id="outlined-basic" label="Interest Type" variant="outlined" />
      </Box>
      <TextField type="number" id="outlined-basic" label="Loan Type" variant="outlined" />
      <TextField id="outlined-basic" label="Term" variant="outlined" />
      <TextField id="outlined-basic" label="Properties" variant="outlined" />
      <TextField id="outlined-basic" label="Additional Securities" variant="outlined" />
      <TextField id="outlined-basic" label="is Coborrowed" variant="outlined" />
      <Button variant="contained">Submit</Button>;


      </Container>
      </FormControl>
    </React.Fragment>
    <div className="App">








    </div>
    </>
  );
}

export default App;
